import axios from "axios";
import API_URL from "./backendConfig";
import authHeader from "./auth-header";
import config from "bootstrap/js/src/util/config";

const searchUser = () => {
    return axios.post(API_URL + "friend/search",{},{ headers: authHeader() })

};
const getFriends = () => {
    return axios.post(API_URL + "friend/getFriends",{},{ headers: authHeader() })

};
const
    friendPageService = {
    searchUser,
    getFriends
};

export default friendPageService;
